package: github.com/neilschelly/s3awslogbeat
import:
- package: github.com/aws/aws-sdk-go
  subpackages:
  - aws
  - aws/credentials
  - aws/session
  - service/s3
  - service/sqs
- package: github.com/elastic/beats
  subpackages:
  - libbeat/beat
  - libbeat/cfgfile
  - libbeat/common
  - libbeat/logp
  - libbeat/publisher
- package: github.com/prometheus/client_golang
  version: v1.10.0
  subpackages:
  - prometheus
  - prometheus/promauto
  - prometheus/promhttp
